import './App.css';

function Joey() {
    const colorSong = {
        'Reading': 'https://www.youtube.com/embed/READING_VIDEO_ID',
        'Science': 'https://www.youtube.com/embed/SCIENCE_VIDEO_ID',
        'Math': 'https://www.youtube.com/embed/MATH_VIDEO_ID',
        'Social Studies': 'https://www.youtube.com/embed/SOCIAL_STUDIES_VIDEO_ID',
    }

    const [selectedColor, setSelectedColor] = useState('Reading');

    const handleColorChange = (event) => {
        setSelectedColor(event.target.value);
    }

    return (
        <div className="joey">
